  <body class="index" x-data="{ navOpen: false }" x-cloak>
    <a
      href="#"
      id="nav-button"
      @click="navOpen = !navOpen"
      :class="{'open': navOpen }">
      <span>
        NAV
        <img src="/images/navbar.png" />
      </span>
    </a>
    <div class="toc-wrapper" :class="{'open': navOpen }">
      
      <img src="/images/logo.png" class="logo" />

      
        <div class="search" x-data="searchController">
          <input
            x-model.debounce.100ms="query"
            type="search"
            class="search"
            id="input-search"
            placeholder="Søk" />
          <ul
            class="search-results visible"
            x-show="results.length > 0"
            x-transition.duration.700ms>
            <template x-for="item in results">
              <li>
                <a x-text="item.title" :href="`#${item.id}`"></a>
              </li>
            </template>
          </ul>
        </div>
      
      
      
        <ul class="toc-footer">
          <li class="toc-h1">
            Omsetjing
          </li>
          
  <ul>
    
      <li class="toc-h2">
        <a href="http://localhost:1313/404.html">English</a>
      </li>
    
  </ul>


        </ul>
      
      
        <ul class="toc-footer">
          
            <li>
              <a href='#'>Registrer deg for ein utviklarnøkkel</a>
            </li>
          
            <li>

      <div class="content">
        
  <h2>Page Not Found!</h2>

      </div>
      <div class="dark-box">
        
          <div
            class="lang-selector"
            x-data="langController"
            x-init="initLangs([{&#34;key&#34;:&#34;go&#34;,&#34;name&#34;:&#34;Go&#34;},{&#34;key&#34;:&#34;shell&#34;,&#34;name&#34;:&#34;Shell&#34;},{&#34;key&#34;:&#34;ruby&#34;,&#34;name&#34;:&#34;Ruby&#34;},{&#34;key&#34;:&#34;python&#34;,&#34;name&#34;:&#34;Python&#34;},{&#34;key&#34;:&#34;javascript&#34;,&#34;name&#34;:&#34;Javascript&#34;},{&#34;key&#34;:&#34;java&#34;,&#34;name&#34;:&#34;Java&#34;}])">
            <template x-for="(tab, index) in tabs">
              <a
                x-text="tab.name"
                :class="{ 'active': tab.active }"
                @click="changeLanguage(index)"></a>
            </template>
          </div>
        
      </div>
    </div>
